First, we need to find the slope of the line $3x-7y = 65$. We can rewrite the given equation in the slope-intercept form $y = mx + b$, where $m$ is the slope. 

From $3x-7y = 65$, we can isolate $y$:
\begin{align*}
3x - 7y &= 65 \\
-7y &= -3x+65 \\
y &= \frac{3}{7}x - \frac{65}{7}
\end{align*}

So, the slope of the original line is $m = \frac{3}{7}$.

Since the line we want is parallel to this line, it will have the same slope. The equation of the line passing through $(7,4)$ and $(0,K)$ is $y = \frac{3}{7}x + b$. 

Using the point $(7,4)$, we can substitute $x=7$ and $y=4$ into the equation:
\begin{align*}
4 &= \frac{3}{7}(7) + b \\
4 &= 3 + b \\
b &= 1
\end{align*}

Therefore, the equation of the line is $y = \frac{3}{7}x + 1$. 

To find the value of $K$ when $x=0$, we substitute $x=0$ into the equation:
\begin{align*}
K &= \frac{3}{7}(0) + 1 \\
K &= 1
\end{align*}

Therefore, the value of $K$ is $\boxed{1}$.

