Let $j$ be John's age and $d$ be his dad's age. We are trying to find the value of $d$. We can create a system of two equations to represent the given information. They are

\begin{align*}
j &= d - 31 \\
j + d &= 53 \\
\end{align*}

We want to find $d$, so we need to eliminate $j$ from the equations above. Substituting the first equation into the second to eliminate $j$, we have $(d-31)+d=53$, or $d=42$. Thus, John's dad is $\boxed{42}$ years old.

Let $C$ be the cost of carpeting a floor and $A$ be the area.  By the definition of a direct proportion, we know that $C=kA$, where $k$ is a constant.  Substituting $105$ for $C$ and $14\times 5=70$ for $A$, we can find that $k=3/2$.  Then, the cost to carpet a floor that is $16\times13$ square feet will be: \begin{align*}
C&=kA\\
&=(3/2)(16\times13)\\
&=\boxed{312 \text{ dollars}}.
\end{align*}

