\begin{aligned} (p_2+k+p_2)(p_2+k-p_2) &= 1488 \\ (2p_2 + k)k &= 1488 \end{aligned}

Since the two primes are less than $50$, $p_2<50$. Trying values of $p_2$ less than $50$, the only solution to the above equation is $p_2 = 23$, which makes $p_1 = 31$. Thus, the primes are $\boxed{23,31}$.

