We first complete the square by considering the quadratic $4s^2 + 28s$. To find the square that this is a part of, we divide the coefficient of the linear term by $2$ and square it. So, $(28/2)^2 = 196$. To ensure that this doesn't change the value of the expression, we add and subtract $196$ to get:
\begin{align*}
4s^2 + 28s &= 4s^2 + 28s + 196 - 196 \\
&= 4(s^2 + 7s + 49) - 196.
\end{align*}
Now, $s^2 + 7s + 49 = (s + 3.5)^2$, so
\begin{align*}
4s^2 + 28s + 45 &= 4(s^2 + 7s + 49) - 196 + 45 \\ 
&= 4(s + 3.5)^2 - 151.
\end{align*}
Therefore, in the form $(cs + p)^2 + q$, $q = \boxed{-151}$.

