\begin{align*} a+b+c+d+e&=a+(a+d)+(a+2d)+(a+3d)+(a+4d) \\ &=5a+10d \\ &=5(a+2d) \\ &=30. \end{align*}
Therefore, $a+2d=6\Rightarrow a+2d=6\Rightarrow a=6-2d$. Since $a$ and $2d$ have opposite parity, $a$ must be odd and $2d$ must be even. Adding odd and even numbers will always give an odd number, but $30$ is even, so $5(a+2d)$ cannot be $30$. Thus, $\boxed{\text{(E)}\ e}$ can be determined.

