Let $a$, $b$, $c$, and $d$ represent the weights of Abby, Bart, Cindy, and Damon, respectively. 

From the given information, we have the following system of equations:
\begin{align*} a + b &= 160 \\ b + c &= 180 \\ c + d &= 200 \end{align*}

Now, since Abby and Bart weigh a total of 160 pounds and Bart and Cindy weigh a total of 180 pounds, we have:
\begin{align*} a + b + c - c &= 160 + 180 \\ a - c &= 340 \\ a &= c + 340 \end{align*}

Similarly, we can also express the weight of Bart in terms of $c$ since in both instances he is compared to the other person weighing 180 pounds:
\begin{align*} b &= 180 - c \end{align*}

Now we can substitute these expressions back into the first equation:
\begin{align*} a + b &= 160 \\ (c + 340) + (180 - c) &= 160 \\ 520 &= 160 \\ c &= -360 \end{align*}

This contradicts the information given, so there must have been a mistake in the earlier equations, likely when extracting the respective weights from the total weights. Let's try again. 

We have:
\begin{align*} b &= 160 - a \\ c &= 180 - b = 180 - 160 + a = 20 + a \\ d &= 200 - c = 200 - 20 - a = 180 - a \end{align*}

So Abby and Damon weigh a total of $a + d = a + (180-a) = 180$ pounds. Therefore, Abby and Damon weigh $\boxed{180 \text{ pounds}}$ together.

