\begin{align*}
\dfrac{\sqrt{x}}{x\sqrt{3}+\sqrt{2}} &= \dfrac{1}{2x\sqrt{6}+4} \\
\Rightarrow \sqrt{x} &= \dfrac{x\sqrt{3}+\sqrt{2}}{2x\sqrt{6}+4} \\
\Rightarrow \sqrt{x} &= \dfrac{x(\sqrt{3})+\sqrt{2}}{2x(\sqrt{6})+4} 
