x &= \dfrac{3x^2 + 4x\sqrt{6} + 2}{24x^2 + 32\sqrt{6}x + 16} 
\end{align*}

Multiplying by $24x^2 + 32\sqrt{6}x + 16$ to get rid of the denominator, we have

